## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import { createContext } from "react";

const TooltipContext = createContext();

export default TooltipContext;
```
### Step 2: Create a TooltipProvider

Create a TooltipProvider.js file in the components folder and add the following code.
```
import { useState } from "react";
import TooltipContext from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Step 3: Create a Tooltip component

Create a Tooltip.js file in the components folder and add the following code.
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = () => {
  const { tooltip, setTooltip, closeTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip__content">
        <p>Tooltip Content</p>
        <button onClick={closeTooltip}>Close</button>
      </div>
    </div>
  );
};

export default Tooltip;
```
### Step 4: Create a TooltipTrigger component

Create a TooltipTrigger.js file in the components folder and add the following code.
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const TooltipTrigger = () => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip__trigger" onClick={() => setTooltip(true)}>
      Tooltip Trigger
    </div>
  );
};

export default TooltipTrigger;
```
### Step 5: Create a TooltipWrapper component

Create a TooltipWrapper.js file in the components folder and add the following code.
```
import TooltipProvider from "./TooltipProvider";
import Tooltip from "./Tooltip";
import TooltipTrigger from "./TooltipTrigger";

const TooltipWrapper = () => {
  return (
    <TooltipProvider>
      <TooltipTrigger />
      <Tooltip />
    </TooltipProvider>
  );
};

export default TooltipWrapper;
```
### Step 6: Use the TooltipWrapper component

Now we can use the TooltipWrapper component in any page or component we want to use the Tooltip component.
```
import TooltipWrapper from "../components/TooltipWrapper";

const Home = () => {
  return (
    <div>
      <TooltipWrapper />
    </div>
  );
};

export default Home;
```
